const app = require('express')();
const express = require("express");
const server = require('http').Server(app);
const io = require('socket.io')(server);
const fs = require("fs")

server.listen(3000);
app.use(express.static("./static"));

const img512 = "data:image/jpg;base64,"
let bufferData512 = Buffer.from(img512.substring(img512.indexOf(',') + 1), 'utf-8')
const img16 = "data:image/jpg;base64,"
let bufferData16 = Buffer.from(img16.substring(img16.indexOf(',') + 1), 'utf-8')
const img128 = "data:image/jpg;base64,"
let bufferData128 =  Buffer.from(img128.substring(img128.indexOf(',') + 1), 'utf-8')
// console.log(bufferData16,"bufferData")
io.on('connection', function (socket) {
    var num = 0
    var interval = setInterval( ()=>{
        socket.emit('message',{
            data: bufferData16,
            startTime: (new Date()).getTime()
        } );
        num++
        if (num > 600){
            socket.emit('stop',{
                data: "stop",
            } );
            clearInterval(interval)
        }
    },1000/60)
});